def filter_ivs(ivs: list[bytes], byte_index: int) -> list:
    results = []
    for i in range(len(ivs)):
        six = 6
        if byte_index == 0:
            six = 6
        elif byte_index == 1:
            six = 9
        elif byte_index == 2:
            six = 10
        elif byte_index == 3:
            six = 11
        if int.from_bytes(ivs[i][0:1], byteorder='big') == byte_index + 3 and int.from_bytes(ivs[i][1:2], byteorder='big') == 255:
            # print("IV: ", ivs[i])
            result = (int.from_bytes(ivs[i][3:4], byteorder='big') - int.from_bytes(ivs[i][2:3], byteorder='big') - six) % 256 # eventuell nicht statisch
            results.append(result)
    return results

def get_occurence(results: list, num: int) -> dict:
    occurences = {}
    for item in results:
        if (item in occurences):
            occurences[item] += 1
        else:
            occurences[item] = 1
    result = sorted(occurences.items(), key=lambda x: x[1], reverse=True)[num][0]
    return result

